// OrdersComponent.js

import React, { useState, useEffect } from 'react';

const LiveOrdersComponent = () => {
  const [orders, setOrders] = useState([]);

  useEffect(() => {

    const userInfo = {
      userId: 999999,
      password: "userPassword", // Caution with sensitive info
      groupNum: 100
    };


    fetch('/api/data/get-live-orders') // Adjust the endpoint as needed.
      .then(response => response.json())
      .then(data => setOrders(data))
      .catch(error => console.error('Error fetching orders:', error));
  }, []);

  return (
    <div>
      <h2>Orders</h2>
      <ul>
        {orders.map(order => (
          <li key={order.id}>
            Order ID: {order.id}, Status: {order.status}, Quantity: {order.quantity}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default LiveOrdersComponent;
